import React from "react";
import Card from "react-bootstrap/Card";
import ImageSource from "../Assets/img3.jpg";
function image() {
  return (
    <div>
      <Card>
        <Card.Img variant="top" source={ImageSource} />
      </Card>
    </div>
  );
}

export default image;
